public class PowerOfThree {
    public boolean isPowerOfThree(int n) {
        // Check for edge cases
        if (n <= 0) return false;

        // Use logarithm base 3 to check if n can be expressed as 3^x
        double logValue = Math.log(n) / Math.log(3);

        // Round down the result because we're checking for exact powers of 3
        int roundedLogValue = (int) Math.floor(logValue);

        // Check if the original value matches its own logarithm with floor rounding
        return Math.pow(3, roundedLogValue) == n;
    }

    public static void main(String[] args) {
        PowerOfThree solution = new PowerOfThree();
        System.out.println(solution.isPowerOfThree(27)); // Output: true
        System.out.println(solution.isPowerOfThree(0)); // Output: false
        System.out.println(solution.isPowerOfThree(-1)); // Output: false
    }
}
```

### Explanation:

1. **Edge Cases**:
   - If `n` is less than or equal to zero, immediately return `false`.
   - If `n` equals one (`1`), return `true`.

