   - Calculate the logarithm of `n` to base 3 using `Math.log()`.
   - Divide this by `Math.log(3)` to get `log_3(n)`.
   - Convert this floating-point number to an integer by taking the floor.

3. **Comparison**:
   - Compute `3` raised to the power of the floored logarithm.
   - Compare the result with the original number `n`. If they match, then `n` is a power of three; otherwise, it isn't.

